-- Migration: Update old song IDs to new format in user_list_items
-- This is a one-time migration to escape the id_mapping.json dependency

-- Create temporary table with mappings
CREATE TEMP TABLE id_migrations (
    old_id TEXT PRIMARY KEY,
    new_id TEXT NOT NULL
);

-- Insert all mappings

-- Update user_list_items with new IDs
UPDATE user_list_items
SET song_id = im.new_id
FROM id_migrations im
WHERE user_list_items.song_id = im.old_id;

-- Report how many rows were updated
DO $$
DECLARE
    updated_count INTEGER;
BEGIN
    GET DIAGNOSTICS updated_count = ROW_COUNT;
    RAISE NOTICE 'Updated % song IDs in user_list_items', updated_count;
END $$;

-- Temp table is automatically dropped at end of transaction

